void StopWatch_execute(void)
{
  UNITY_LINE_TYPE cmock_line = TEST_LINE_NUM;
  CMOCK_StopWatch_execute_CALL_INSTANCE* cmock_call_instance;
  UNITY_SET_DETAIL(CMockString_StopWatch_execute);
  cmock_call_instance = (CMOCK_StopWatch_execute_CALL_INSTANCE*)CMock_Guts_GetAddressFor(Mock.StopWatch_execute_CallInstance);
  Mock.StopWatch_execute_CallInstance = CMock_Guts_MemNext(Mock.StopWatch_execute_CallInstance);
  if (Mock.StopWatch_execute_IgnoreBool)
  {
    UNITY_CLR_DETAILS();
    return;
  }
  if (!Mock.StopWatch_execute_CallbackBool &&
      Mock.StopWatch_execute_CallbackFunctionPointer != NULL)
  {
    Mock.StopWatch_execute_CallbackFunctionPointer(Mock.StopWatch_execute_CallbackCalls++);
    UNITY_CLR_DETAILS();
    return;
  }
  UNITY_TEST_ASSERT_NOT_NULL(cmock_call_instance, cmock_line, CMockStringCalledMore);
  cmock_line = cmock_call_instance->LineNumber;
  if (cmock_call_instance->CallOrder > ++GlobalVerifyOrder)
    UNITY_TEST_FAIL(cmock_line, CMockStringCalledEarly);
  if (cmock_call_instance->CallOrder < GlobalVerifyOrder)
    UNITY_TEST_FAIL(cmock_line, CMockStringCalledLate);
  if (Mock.StopWatch_execute_CallbackFunctionPointer != NULL)
  {
    Mock.StopWatch_execute_CallbackFunctionPointer(Mock.StopWatch_execute_CallbackCalls++);
  }
  UNITY_CLR_DETAILS();
}

